class Complex {
    constructor(real,imag = 0) {
        this.real = real;
        this.imag = imag;
    }
    add(complex) {
        return new Complex(this.real + complex.real,this.imag + complex.imag)
    }
    sub(complex) {
        return new Complex(this.real - complex.real,this.imag - complex.imag)
    }
    mul(complex) {
        return new Complex(this.real * complex.real - this.imag * complex.imag,this.imag * complex.real + this.real * complex.imag)
    }
}

